import "./App.css";
import styled from "styled-components";
import { useAppSelector, useAppDispatch } from "./hooks";
import { addTimestamp } from "./slices/todo";

const Wrapper = styled.div`
  padding: 1.5rem;
`;

const AA = styled.p`
  color: blue;
`;

const Title = styled.h2`
  font-weight: 900;
  margin-top: 2rem;
`;

const NoteInput = styled.input`
  width: 100%;
  height: 40px;
  border-radius: 10px;
  padding-left: 0.5rem;
  box-sizing: border-box;
`;

const SubmitBtn = styled.button`
  width: 100%;
  box-sizing: border-box;
  height: 40px;
  background: #000;
  display: flex;
  justify-content: center;
  align-items: center;
  color: #fff;
  border-radius: 10px;
  border: 0;
  font-weight: 900;
  margin-top: 1rem;

  :active {
    background: #000000be;
  }
`;

const Item = styled.div`
  margin-top: 1rem;

  > b {
    margin-right: 0.5rem;
  }
`;

function App() {
  const todoReducer = useAppSelector((state) => state.todoReducer);
  const todoList = todoReducer.todoList;

  const dispatch = useAppDispatch();

  return (
    <Wrapper>
      <Title>TODO LIST</Title>
      <AA>djkddk</AA>
      <NoteInput type="text" />
      <SubmitBtn
        onClick={() => {
          dispatch(addTimestamp);
        }}
      >
        Submit
      </SubmitBtn>
      <SubmitBtn>Record Timestamp</SubmitBtn>
      <Title>List</Title>
      {todoList.map((data, index) => {
        return (
          <Item key={data}>
            <b>{index + 1}</b>
            {data}
          </Item>
        );
      })}
    </Wrapper>
  );
}

export default App;
